/*Table structure for table `Houses` */

DROP TABLE IF EXISTS `Houses`;

CREATE TABLE `Houses` (
  `uuid` binary(16) NOT NULL COMMENT 'Id de la vivienda',
  `number` int(11) NOT NULL COMMENT 'N√∫mero de la vivienda',
  `code` varchar(100) CHARACTER SET utf8 NOT NULL COMMENT 'C√≥digo de la vivienda',
  `qrcode` varchar(100) CHARACTER SET utf8 DEFAULT NULL COMMENT 'C√≥digo QR',
  `latitude` decimal(9,6) DEFAULT NULL COMMENT 'Latitude',
  `longitude` decimal(9,6) DEFAULT NULL COMMENT 'Longitude',
  `streetName` varchar(250) CHARACTER SET utf8 DEFAULT NULL COMMENT 'Calle',
  `streetNumber` varchar(50) CHARACTER SET utf8 DEFAULT NULL COMMENT 'Nvarchar para dar cobertura a casos tipo ''10 A'', ''10 B'' o ''26 BIS''',
  `personsNumber` int(10) NOT NULL DEFAULT '0' COMMENT 'N√∫mero de habitantes',
  `areaId` int(11) NOT NULL COMMENT 'Id de la manzana',
  PRIMARY KEY (`uuid`),
  UNIQUE KEY `UQ_Houses_uuid` (`uuid`),
  KEY `areaId` (`areaId`),
  CONSTRAINT `FK_Houses_Areas` FOREIGN KEY (`areaId`) REFERENCES `Areas` (`id`) ON UPDATE CASCADE
