/* Trigger structure for table `Areas` */

DELIMITER $$

/*!50003 DROP TRIGGER*//*!50032 IF EXISTS */ /*!50003 `areasCreateDescendants` */$$

/*!50003 CREATE */ /*!50017 DEFINER = 'sapev'@'%' */ /*!50003 TRIGGER `areasCreateDescendants` AFTER INSERT ON `Areas` FOR EACH ROW CALL updateDescendants(NEW.id) */$$


DELIMITER ;

/* Procedure structure for procedure `updateDescendants` */

/*!50003 DROP PROCEDURE IF EXISTS  `updateDescendants` */;

DELIMITER $$

/*!50003 CREATE DEFINER=`sapev`@`%` PROCEDURE `updateDescendants`(areaId INT)
BEGIN
	SET @parent = areaId;
	SET @level = 0;
	REPEAT 
		INSERT INTO AreaDescendants(areaId, descendantId, LEVEL) VALUES(@parent, areaId, @level);
		SELECT parentId INTO @parent FROM Areas WHERE id = @parent;
		SET @level = @level + 1;
	UNTIL @parent IS NULL OR @level > 20 END REPEAT;
    END */$$
DELIMITER ;

